import React from "react";
import "./Button.css";

const buttonData = [
  { id: "1", name: "1" },
  { id: "2", name: "2" },
  { id: "3", name: "3" },
];

class Button extends React.Component {
  constructor() {
    super();
  }

  render() {
    const info = buttonData.map((info) => <button id={info.id} />);

    return info;
  }
}

export default Button;
